let _menhir_print_token : token -> string =
  fun _tok ->
    match _tok with
    | ALL ->
        "ALL"
    | ARROW ->
        "ARROW"
    | AS ->
        "AS"
    | CIDENT _ ->
        "CIDENT"
    | COLON ->
        "COLON"
    | COLONCOLON ->
        "COLONCOLON"
    | COMMA ->
        "COMMA"
    | DOLAR ->
        "DOLAR"
    | DOT ->
        "DOT"
    | DOUBLEARROW ->
        "DOUBLEARROW"
    | EOF ->
        "EOF"
    | EQUAL ->
        "EQUAL"
    | EXI ->
        "EXI"
    | FUN ->
        "FUN"
    | IN ->
        "IN"
    | INCLUDE ->
        "INCLUDE"
    | INT _ ->
        "INT"
    | LAMBDA ->
        "LAMBDA"
    | LANGLE ->
        "LANGLE"
    | LBRACE ->
        "LBRACE"
    | LBRACKET ->
        "LBRACKET"
    | LET ->
        "LET"
    | LIDENT _ ->
        "LIDENT"
    | LPAREN ->
        "LPAREN"
    | OPTION ->
        "OPTION"
    | RANGLE ->
        "RANGLE"
    | RBRACE ->
        "RBRACE"
    | RBRACKET ->
        "RBRACKET"
    | REC ->
        "REC"
    | RPAREN ->
        "RPAREN"
    | SEMI ->
        "SEMI"
    | STAR ->
        "STAR"
    | STRING _ ->
        "STRING"
    | TTYPE ->
        "TTYPE"
    | TYPE ->
        "TYPE"
    | VAL ->
        "VAL"

let _menhir_fail : unit -> 'a =
  fun () ->
    Printf.eprintf "Internal failure -- please contact the parser generator's developers.\n%!";
    assert false

